import React, { useContext } from 'react';
import { StyleSheet, Text, View } from 'react-native';

import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
const Stack = createStackNavigator();
import CreateTrack from "./src/screens/CreateTrack";
import LoginScreen from "./src/screens/LoginScreen";
import RegisterScreen from "./src/screens/RegisterScreen";
import TrackDetail from "./src/screens/TrackDetail";
import TrackLIst from "./src/screens/TrackLIst";
import AccountScreen from "./src/screens/AccountScreen";
import { Provider as AuthProvider } from "./src/context/AuthContext"
import { Context as AuthContext } from "./src/context/AuthContext"

const { Navigator, Screen } = Stack;

export default function App() {
  const Logging = [
    { name: "RegisterScreen", component: RegisterScreen, options: { title: "Register" }  },
    { name: "LoginScreen", component: LoginScreen, options: { title: "Login" } },
  ]
  const LoggedIn = [
    { name: "CreateTrack", component: CreateTrack, options: {} },
    { name: "TrackDetail", component: TrackDetail, options: {} },
    { name: "TrackLIst", component: TrackLIst, options: {} },
    { name: "AccountScreen", component: AccountScreen, options: {} }
  ]

  const state  = useContext(AuthContext);
  console.log('state: ', state);
  return (
    <AuthProvider>
      {state?
        <NavigationContainer>
          <Navigator initialRouteName="RegisterScreen" headerMode="screen" screenOptions={{ headerTintColor: 'white', headerStyle: { backgroundColor: "black", color: "white" }, }}>
            {LoggedIn.map((temp, index) => (
              <Screen name={temp.name} key={index} component={temp.component} options={temp.options} />
            ))}
          </Navigator>
        </NavigationContainer> :
        <NavigationContainer>
          <Navigator initialRouteName="TrackLIst" headerMode="screen" screenOptions={{ headerTintColor: 'white', headerStyle: { backgroundColor: "black", color: "white" }, }}>
            {Logging.map((temp, index) => (
              <Screen name={temp.name} key={index} component={temp.component} options={temp.options} />
            ))}
          </Navigator>
        </NavigationContainer>
      }
    </AuthProvider>
  );

}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
